import '../static/styles.scss';

const Box = () => {
    return (
        <div className="box">
            <div className="input-group">
                <label>아이디</label>
                <input></input>
            </div>
            <div className="input-group">
                <label>비밀번호</label>
                <input></input>
            </div>
            <button>로그인</button>
        </div>
    );
};

export default Box;
